import styled from 'styled-components';


const ButtonStyle = styled.div`
    padding:14px 25px;
    display: flex;    
    width: auto;
    border-radius: 25px;
    border: 1px solid #0F1C51;
    display:flex;
    justify-content: center;
    cursor:pointer;
    width: auto;


`;

export { ButtonStyle };
